import React from "react";
import Card from "./Card";

import services from "./services";

function Cards() {
 
  return (
    <div className="container pt-10 d-flex justify-content-center h-100 align-items-center">
      <div className="row">
        {Cards.map((card) => (
          <div className="col-md-4" key={services.id}>
            <Card title={services.title}></Card>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Cards;
